import React from 'react';
import NewsCard from '../NewsCard/NewsCard';

function NewsCardList({ cards }) {
    return (
      <div>
        {cards.map((savedCard, index) => (
          <div key={index}>
            {/* Mostrar la información de la tarjeta */}
            <p>{savedCard.title}</p>
            <p>{savedCard.description}</p>
            {/* Mostrar las consultas de búsqueda asociadas */}
            <p>Consultas de búsqueda: {savedCard.searchQueries.join(', ')}</p>
          </div>
        ))}
      </div>
    );
  }

export default NewsCardList;
